import React from 'react';
import { Link } from "react-router-dom";

function Home() {
    return (
        <div>
            <h1>Welcome Aequalis's Prototype Demonstration.</h1>
            <Link to="internal">Internal Invoicing Page for Hospitals</Link>
            <Link to="public">Visualization Page Accessible to Public</Link>
        </div>
    );
};

export default Home;
